    false,nt"url": null,nt"notes": "Gold coral (Gerardia sp.) trees that were
    inspected years earlier on Pisces submersible dives were revisited and their change
    in size measured. The fishery for Gerardia operates using an estimate of average
    growth at 6mm/yr which would yield adult trees in a span of a few to several decades.
    In contrast independent radiometric studies suggest that large adult Gerardia colonies
    could be as much as a millenia old. The intent of this work was to revisit corals
    that had been inspected earlier and see if any appreciable growth could be seen.
    If not then the 6mm/yr estimate could be dismissed.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
